    [],nt"revision_timestamp": "2016-07-27T22:41:54.912145",nt"name": "contaminants-investigation-of-aransas-dredge-spoil-islands-texas-1988-1989",nt"isopen":
    false,nt"url": null,nt"notes": "Organochlorine, trace element, and petroleum
    hydrocarbon contaminants were examined in sediments and biota from dredge spoil
    islands adjacent to Aransas National Wildlife Refuge, Texas. Trace elements were
    200-500% higher in spoil sediments than local bays. Mercury levels were not elevated
    in either sediments or biota; other trace elements were detected at moderate levels
    in most biota samples. Sheepshead minnows from Aransas dredge spoil sites had higher
    levels of most trace elements than sheepshead minnows from a control site in Flour
    Bluff, Texas, whereas trace element levels in water boatmen from Aransas dredge
    spoil sites were generally lower than water boatmen from an evaporation pond in
    California. Organochlorines were not detected in sediments, and the low levels of
    aliphatic hydrocarbons detected in sediments are assumed to be primarily of biogenic
    origin. Aromatic hydrocarbons were also detected in sediments and biota, but at
    very low concentrations. In general, this study indicates that a majority of contaminants
    evaluated were below levels of concern, however, chromium, copper, and lead were
    detected at elevated levels in both sediment and biota and should be considered
    as part of future monitoring programs.",nt"license_title": "License Not Specified",nt"extras":
